import React, {useState} from 'react';
import Button from '../Button';
import '../../App.css';
import {Settings} from './Settings';

const SettingsCounter = () => {
    const [startValue, setStartValue] = useState('')
    const btnSetHandler = () => {
        const value = parseInt(startValue, 10);
        setCount(value);
    }

    return (
        <div className={'main'}>
            <div className={'settings'}>
                <Settings startValue={startValue} onStartValueChange={setStartValue} onSetClick={btnSetHandler} />
            </div>
            <div className={'buttons'}>
                <Button title={'Set'} btnClick={btnSetHandler} disabled={false}/>
            </div>
        </div>
    );
};

export default SettingsCounter;
